import React from 'react'
import { details2, details1, details3 } from './file'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import './Events.css'
const Events = () => {
    const handleSubmit = () => {

        window.open('https://docs.google.com/forms/d/e/1FAIpQLSfWwYa7gpwvi0Q_WSqnj7S7Zqf4WUfnwjtfIKeDFPMCyEK07g/viewform?usp=sf_link', '_blank');

    }

    return (
        <div className='events'>
            <div className='workshops'>
                {
                    details2.map((item, index) => {
                        return (
                            <div className='single-card' key={index}>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src={item.img} />
                                    <Card.Body>
                                        <Card.Title style={{ color: '#FF00FF' }}>{item.title}</Card.Title>
                                        <Card.Text>
                                            {item.time}
                                        </Card.Text>
                                        <Card.Text><span style={{ color: '#7FFF00' }}>Registration Fee :  </span>{item.Fee}</Card.Text>
                                        <Card.Text><span>Student Coordinator :  </span>{item.StudentIncharge}</Card.Text>
                                        <Card.Text>{item.Mentor}<span> </span></Card.Text>
                                        <Button variant="success" className='btn1' ><a href={item.ppt} alt='error'>View Details</a></Button>
                                        <Button variant="primary" className='btn2' onClick={handleSubmit}>Register</Button>
                                    </Card.Body>
                                </Card>
                            </div>
                        )
                    })
                }
            </div>
            <div className='presentations'>
                {
                    details1.map((item, index) => {
                        return (
                            <div className='single-card' key={index}>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src={item.img} />
                                    <Card.Body>
                                        <Card.Title style={{ color: '#FF00FF' }}>{item.title}</Card.Title>
                                        <Card.Text>
                                            {item.time}
                                        </Card.Text>
                                        <Card.Text><span style={{ color: '#7FFF00' }}>Registration Fee :  </span>{item.Fee}</Card.Text>
                                        <Card.Text><span>Student Coordinator :  </span>{item.StudentIncharge}</Card.Text>
                                        <Card.Text>{item.Mentor}<span> </span></Card.Text>
                                        <Button variant="success" className='btn1' ><a href={item.ppt} alt='error'>View Details</a></Button>
                                        <Button variant="primary" className='btn2' onClick={handleSubmit}>Register</Button>
                                    </Card.Body>
                                </Card>
                            </div>
                        )
                    })
                }
            </div>
            <div className='spot'>
                {
                    details3.map((item, index) => {
                        return (
                            <div className='single-card' key={index}>
                                <Card style={{ width: '18rem' }}>
                                    <Card.Img variant="top" src={item.img} />
                                    <Card.Body>
                                        <Card.Title style={{ color: '#FF00FF' }}>{item.title}</Card.Title>
                                        <Card.Text>
                                            {item.time}
                                        </Card.Text>
                                        <Card.Text><span style={{ color: '#7FFF00' }}>Registration Fee :  </span>{item.Fee}</Card.Text>
                                        <Card.Text><span>Student Coordinator :  </span>{item.StudentIncharge}</Card.Text>
                                        <Card.Text>{item.Mentor}<span> </span></Card.Text>
                                        <Button variant="success" className='btn1' ><a href={item.ppt} alt='error'>View Details</a></Button>
                                        <Button variant="primary" className='btn2' onClick={handleSubmit}>Register</Button>
                                    </Card.Body>
                                </Card>
                            </div>
                        )
                    })
                }
            </div>

        </div>
    )
}

export default Events
